import React from 'react';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Typography from '@material-ui/core/Typography';
import Slider from "react-slick";

// docs
// https://react-slick.neostack.com/docs/example/adaptive-height

const styles = {
  card: {
    marginLeft: 25,
    marginRight: 25
  },
  media: {
    height: 400,
  },
}

class PortfolioCarousel extends React.Component {

  openModal = () => {
    console.log("clicking")
  };
  render(){
    var settings = {
      className: "center",
      centerMode: true,
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      variableWidth: true,
      adaptiveHeight: true,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        }
      ]
    };
    return(
      <div>
      <h1>Projects</h1>
      <Slider {...settings}>
        <div style={{ width: 600 }}>
            <Card style={styles.card}>
              <CardActionArea>
                <CardMedia
                  style={styles.media}
                  image={require('../assets/background1.png')}
                  title="Contemplative Reptile"
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h2">
                    Lizard
                  </Typography>
                  <Typography component="p">
                    Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
                    across all continents except Antarctica
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </div>
          <div style={{ width: 600 }}>
            <Card style={styles.card}>
              <CardActionArea>
                <CardMedia
                  style={styles.media}
                  image={require('../assets/background1.png')}
                  title="Contemplative Reptile"
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h2">
                    Lizard
                  </Typography>
                  <Typography component="p">
                    Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
                    across all continents except Antarctica
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </div>
          <div style={{ width: 600 }}>
            <Card style={styles.card}>
              <CardActionArea>
                <CardMedia
                  style={styles.media}
                  image={require('../assets/background1.png')}
                  title="Contemplative Reptile"
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h2">
                    Lizard
                  </Typography>
                  <Typography component="p">
                    Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
                    across all continents except Antarctica
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </div>
      </Slider>
      </div>
    )
  }
}


export default PortfolioCarousel;
